const playBtn = document.querySelector('#play');
const progress = document.querySelector('#progress');
const songList = document.querySelector('#SongList');
const prevSong = document.querySelector('#previous');
const nextSong = document.querySelector('#Forward');
const songs = [
    {
        name: "BaliyeRe",
        id: 1,
        src: "data:image/jpeg;base64,",
    },
    {
        name: "GaddiNeevi",
        id: 2,
        src: "data:image/jpeg;base64,",
    },
    {
        name: "Rait Zara Si",
        id: 3,
        src: "data:image/jpeg;base64,",
    },
    {
        name: "Slow Slow",
        id: 4,
        src: "data:image/jpeg;base64,",
    },
    {
        name: "Phoonk Le",
        id: 5,
        src: "https://www.ilyrically.com/wp-content/uploads/2022/01/Phoonk-Le.jpg",
    },
    {
        name: "Dance Meri Rani",
        id: 6,
        src: "data:image/jpeg;base64,",
    }
];

const audio = new Audio('./Assets/Baliye Re.mp3');



for (let song of songs) {
    const li = document.createElement('li');
    li.innerText = song.name;
    li.setAttribute('id', song.id);
    li.classList.add('song-item');
    songList.append(li);
}

playBtn.addEventListener('click', function () {
    audio.paused ? audio.play() : audio.pause();
    if (playBtn.children[0].classList.contains('fas fa-play')) {
        playBtn.children[0].classList.remove('fas fa-play');
        playBtn.children[0].classList.add('fas fa-pause');
    }
    else {
        playBtn.children[0].classList.remove('fas fa-pause');
        playBtn.children[0].classList.add('fas fa-play');
    }
    // else if(playBtn.children[0].classList.contains('fas fa-pause'){
    //     console.log("inside else");
    //     playBtn.children[0].classList.remove('fas fa-pause');
    //     playBtn.children[0].classList.add('fas fa-play');
    // }
});

audio.addEventListener('timeupdate', function () {
    const currentProgress = audio.currentTime * 100 / audio.duration;
    progress.value = currentProgress;
});


progress.addEventListener('change', function () {
    const updatedTime = parseInt(audio.duration * progress.value / 100);
    audio.currentTime = updatedTime;
});


songList.addEventListener('click', function (e) {
    const songId = e.target.getAttribute('id');
    audio.src = `./assets/${songId}.mp3`;
    audio.currentTime = 0;
    audio.play();
    playBtn.children[0].classList.remove('fas fa-play');
    playBtn.children[0].classList.add('fas fa-pause')
});
